import {
    GET_DOGS,
} from "./actions"


const initialState = {
    dogs : [],
    allDogs: [],
    temperaments: [],
    detail: [],

} 


function rootReducer (state = initialState, action){
    switch(action.type){
        case GET_DOGS:
        return {
            ...state,
            dogs: action.payload
           

        }
        default:
            return state;
    }
}

export default rootReducer;
